  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114242 includes fish examination
  and biological data collected aboard the CHARTER/FISHING BOATS during cruises FR0206-01,
  FR0206-02, FR0208, SE0005 and SE0007 in the North Pacific Ocean from 2000-05-29
  to 2002-08-18. These data include INDIVIDUAL FISH EXAMINATION - WEIGHT, SPECIES
  IDENTIFICATION, SPECIES IDENTIFICATION - LIFE STAGE and SPECIES IDENTIFICATION -
  SEX. The instruments used to collect these data include trawl. These data were collected
  by Suzan S Pool of Oregon State University and Richard D Brodeur and Robert L Emmett
  of Northwest Fisheries Science Center - Newport as part of NEP. The Biological and
  Chemical Oceanography Data Management Office (BCO-DMO) submitted these data to NODC
  on 2013-10-30.nnThe following is the text of the abstract provided by BCO-DMO:nnContacts
  for this data set:nDr. Richard BrodeurnNorthwest Fisheries Science CenternNational
  Oceanic and Atmospheric AdministrationnNewport, OR 97365nPhone: 541-867-0336nEmail:
  Rick.Brodeur@noaa.govnnRobert EmmettnNorthwest Fisheries Science CenternNational
  Oceanic and Atmospheric AdministrationnNewport, OR 97365nPhone: 541-867-0109nEmail:
  Robert.Emmett@noaa.govnnSuzan PoolnCooperative Institute for Marine Resources StudiesnOregon
  State UniversitynNewport, OR 97365nPhone: 541-867-0195nEmail: Suzan.Pool@noaa.govnnContact
  for ages by scale analysis:nJoseph FishernCollege of Oceanic and Atmospheric SciencesnOregon
  State UniversitynCorvallis, OR 97331nPhone: 541-737-3964nEmail: jfisher@coas.oregonstate.edunContact
  for coded-wire tags collected:nSusan HintonnNorthwest Fisheries Science CenternNational
  Oceanic and Atmospheric AdministrationnHammond, OR 97121nPhone: 503-861-1818nEmail:
  Susan.Hinton@noaa.govnnDuring juvenile salmonid trawling cruises, additional sampling
  included CTD profiles, neuston net tows, and Niskin bottle water collections for
  chlorophyll a. At most stations, data on all parameters were collected.\",\n\t\"owner_org\":
